Given the following program, identify all intermediate or unused variables (it can be a global variable, local variable, function parameter, etc.). Please write the identified variable names into a json: {'target_list': [a list of variable names]}. If no variable is identified, just give an empty list.. The program is void fn1(unsigned p1, int p2) { printf("checksum = %X\n", p1); }
int fn2(int p1, int p2) { return p1 - p2; }
